INSERT INTO `AdminC_Emails` VALUES (1,'ADMINC_NICE','From: accountsccp@iedr.ie\r\nTo: $E_Mail\r\nCc: info@$D_Name\r\nCc: webmaster@$D_Name\r\nCc: postmaster@$D_Name\r\nBcc: hostmaster-archive@domainregistry.ie\r\nBcc: accountsccp@domainregistry.ie\r\nSubject: (Notice of Non-Renewal) Re: $D_Name\r\n\r\n  * * This is very important * * Please read it carefully * *\r\n\r\nDear $Admin_Name\r\n\r\nAs administrative contact for the domain name $D_Name, we would like to inform you that your domain name has not yet been renewed.\r\n \r\nIf the domain name is not renewed it will be suspended in 14 days time, whereby access to your website and email services will become unavailable.  After a further 14 days of suspension, the domain will finally be deleted from the .ie database.  (Please Note: Once your domain name has been deleted it will become available to the general public for re-registration on a first come, first served, basis).\r\n\r\nThe current billing contact for your domain name is: $Nic_Name,  $Co_Name\r\n\r\nRenewal Options:\r\n \r\n(1) Contact your current Billing Contact to renew.\r\n \r\n(2) Designate a new Billing Contact for your domain name by choosing either option (a) or (b) listed below: \r\n \r\n(a) Transfer to a new Billing Contact.  To view IEDR accredited resellers please click on the link (www.iedr.ie/resellers).  \r\nOnce you have selected a new Billing Contact please submit a signed fax to IEDR (01 2300365) authorising the transfer of your domain name to [name of new reseller].\r\n \r\nOR\r\n \r\n(b) If you prefer to be billed directly for your domain name: The following is required by the IEDR. Log onto the IEDR website (http://www.iedr.ie/TransferBillingContact.php) and follow the process. You will be required to submit a signed fax to the IEDR (01 2300365) authorising the transfer of your domain name to yourself, and submit a renewal payment for the domain name.\r\n\r\nImportant note: - By changing the billing contact of your domain name your 