INSERT INTO `Email` VALUES (1,'acceptReg','Dear Registrant,\r\n\r\nThank you very much for your application for the registration of the domain name: $D_Name\r\n\r\nThis has been accepted, and the supplied nameserver information will be verified. If the nameservers are not fully configured a verification failure email will be sent to the email address of the listed technical contact.\r\n\r\nKind regards,\r\nIE Hostmaster\r\n\r\ntel: +353-1-2365 400\r\nfax: +353-1-2300 365\r\nemail: hostmaster@iedr.ie\r\nweb: http://www.iedr.ie\r\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin. \r\nRegistered in Ireland. No: 315315. ','(Acceptance - Application) Re: $D_Name','$admin1','','$bill',NULL),(2,'acceptMod','Dear Registrant,\r\n\r\nThank you very much for your modification request for the domain name: $D_Name\r\n\r\nThis has been accepted, and the supplied nameserver information will be verified. If the nameservers are not fully configured a verification failure email will be sent to the email address of the listed technical contact.\r\n\r\nKind regards,\r\nIE Hostmaster\r\n\r\ntel: +353-1-2365 400\r\nfax: +353-1-2300 365\r\nemail: hostmaster@iedr.ie\r\nweb: http://www.iedr.ie\r\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin. \r\nRegistered in Ireland. No: 315315. ','(Acceptance - $Ticket_Type) Re: $D_Name','$admin1','','$creator',NULL),(3,'acceptDel','Dear Registrant,\r\n\r\nThank you for your deletion request for the domain name: $D_Name\r\n\r\nThis has been accepted and the domain will now be removed from the .ie zone.\r\n\r\nKind regards,\r\nIE Hostmaster\r\n\r\ntel: +353-1-2365 400\r\nfax: +353-1-2300 365\r\nemail: hostmaster@iedr.ie\r\nweb: http://www.iedr.ie\r\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin. \r\nRegistered in Ireland. No: 315315. ','(Acceptance - $Ticket_Type) Re: $D_Name','$admin1','','$creator',NULL),(6,'queryReg','PLEASE DO NOT REPLY TO THIS EMAIL. THIS IS AN AUTOMATED EMAIL\r\n\r\nRemarks : $remark\r\n\r\nIf requested please amend your request at the following URL:\r\n\r\nhttp://www.domainregistry.ie/Login.php?action=Modification\r\n\r\nKind regards,\r\nIE Hostmaster\r\n\r\ntel: +353-1-2365 400\r\nfax: +353-1-2300 365\r\nemail: hostmaster@iedr.ie\r\nweb: http://www.iedr.ie\r\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin. \r\nRegistered in Ireland. No: 315315. ','(Query - $Ticket_Type) Re: $D_Name','$creator','','',NULL),(7,'queryMod','PLEASE DO NOT REPLY TO THIS EMAIL. THIS IS AN AUTOMATED EMAIL\r\n\r\nRemarks : $remark\r\n\r\nIf requested please amend your request at the following URL:\r\n\r\nhttp://www.domainregistry.ie/Login.php?action=Modification\r\n\r\nKind regards,\r\nIE Hostmaster\r\n\r\ntel: +353-1-2365 400\r\nfax: +353-1-2300 365\r\nemail: hostmaster@iedr.ie\r\nweb: http://www.iedr.ie\r\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin. \r\nRegistered in Ireland. No: 315315. ','(Query - $Ticket_Type) Re: $D_Name','$creator','','',NULL),(8,'queryDel','PLEASE DO NOT REPLY TO THIS EMAIL. THIS IS AN AUTOMATED EMAIL\r\n\r\nRemarks : $remark\r\n\r\nIf requested please amend your request at the following URL:\r\n\r\nhttp://www.domainregistry.ie/Login.php?action=Deletion\r\n\r\nKind regards,\r\nIE Hostmaster\r\n\r\ntel: +353-1-2365 400\r\nfax: +353-1-2300 365\r\nemail: hostmaster@iedr.ie\r\nweb: http://www.iedr.ie\r\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin. \r\nRegistered in Ireland. No: 315315. ','(Query - $Ticket_Type) Re: $D_Name','$creator','','',NULL),(9,'alterDel','PLEASE DO NOT REPLY TO THIS EMAIL. THIS IS AN AUTOMATED E-MAIL.\r\n\r\n\r\nYour domain name: $D_Name has been deleted.\r\n\r\nRemarks: $remark\r\n\r\nKind regards,\r\nIE Hostmaster\r\n\r\ntel: +353-1-2365 400\r\nfax: +353-1-2300 365\r\nemail: hostmaster@iedr.ie\r\nweb: http://www.iedr.ie\r\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin. \r\nRegistered in Ireland. No: 315315. ','(Deletion) Re: $D_Name','$admin1,$bill','','',NULL),(10,'transferBill','PLEASE DO NOT REPLY TO THIS EMAIL. THIS IS AN AUTOMATED E-MAIL.\r\n\r\nThe domain name: $D_Name held by $Domain_Holder Billing Contact: $bill_OldNH has been transferred to Billing Contact: $billNH.\r\n\r\nIf the nameserver entries are to be updated, a listed contact for this domain should login to the modification form on our website with their current NicHandle and password to make any necessary changes.\r\n\r\nThe modification form is available at the following link:\r\n\r\nhttps://www.domainregistry.ie/Login.php?action=Modification\r\n\r\nPlease note the New Billing Contact will receive an automated invoice at\r\nthe end of this month. \r\n\r\n*If this transfer has occurred within 30 days of the renewal invoice date, the previous Billing Contact will receive an automated credit note at months end.\r\n\r\n**If the domain has already been renewed by the previous Bill-C NO credit note will be issued the domain will deemed to be renewed for the period invoiced and the transfer invoice to the New Bill-C will advance the renewal date for a further year.\r\n\r\n\r\nKind regards,\r\nIE Hostmaster\r\n\r\ntel: +353-1-2365 400\r\nfax: +353-1-2300 365\r\nemail: hostmaster@iedr.ie\r\nweb: http://www.iedr.ie\r\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin. \r\nRegistered in Ireland. No: 315315.\r\n','(Accept-Account Transfer) Re: $D_Name','$bill, $bll_Old',NULL,NULL,NULL),(11,'alterSus','PLEASE DO NOT REPLY TO THIS E-MAIL.  THIS IS AN AUTOMATED E-MAIL.\r\n\r\nYour domain name $D_Name has been suspended.\r\n\r\nRemarks:  $remark\r\n\r\nKind regards,\r\nIE Hostmaster\r\n\r\ntel: +353-1-2365 400\r\nfax: +353-1-2300 365\r\nemail: hostmaster@iedr.ie\r\nweb: http://www.iedr.ie\r\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin. \r\nRegistered in Ireland. No: 315315. ','(Suspension) Re: $D_Name','$admin1, $bill','','',NULL),(12,'DNSCheckTech','                                                                                                                                                                                                     \n** This is very important ** Please read it carefully ***\n                                                                                                                                                                                                     \nTo whom it concerns,\n                                                                                                                                                                                                     \nThe IE Domain Registry accepted your request to register / modify a\ndomain on $Ad_StatusDt\n                                                                                                                                                                                                     \n- The verification of nameservers was NOT successful for your request.\n- If the configuration is not resolved, your request will lapse in $diff days.\n- The administrator of the nameservers must correct the problems\n  in order for your domain to function on the new nameservers.\n- The IE Domain Registry CANNOT rectify the problem as it lies with your\n  nominated hosting provider.\n                                                                                                                                                                                                     \nWe will recheck the nameserver setup twice each weekday for a maximum of twenty working days\nand will complete the process once the nameserver configuration has been found to be correct.\nRequests that fail continuously for twenty working days will be deemed to have\nlapsed and will drop out of our system, in which case you will be required to resubmit the\nregistration or modification request.\n                                                                                                                                                                                                     \nThe nameserver errors are shown below. Please ensure the responsible\nperson is notified. The nameservers being tested are as follows:\n                                                                                                                                                                                                     \n\n\n ','Important Registration Notice : DNS Failure on Domain $D_Name. $diff days remaining.','','','',NULL),(13,'DNSCheckAdmin','\n** This is very important ** Please read it carefully ***\n\nTo whom it concerns,\n\nThe IE Domain Registry accepted your request to register / modify a\ndomain on $Ad_StatusDt\n\n- The verification of nameservers was NOT successful for your request.\n- If the configuration is not resolved, your request will lapse today.\n- The administrator of the nameservers must correct the problems\n  in order for your domain to function on the new nameservers.\n- The IE Domain Registry CANNOT rectify the problem as it lies with your \n  nominated hosting provider.\n\n*** Repeat ***\n\nYour registration or modification request will lapse today if the nameserver\nerrors are not resolved.\n\nThe nameserver errors are shown below. Please ensure the responsible\nperson is notified. The nameservers being tested are as follows:','Important Registration Notice: DNS Failure on $D_Name','','','',NULL),(14,'DNSAcceptReg','\n\n\nDear Registrant,\n\nWe have verified the hosting information provided in your application.\n\nYour application for $D_Name, registered to ($Domain_Holder), has now been fully accepted.\n\nYour domain will go live when the IE zone is next reloaded. This occurs at 10am, 12pm, 5pm and 10pm daily.\n\nKind regards,\nIE Hostmaster\n\ntel: +353-1-2365 400\nfax: +353-1-2300 365\nemail: hostmaster@iedr.ie\nweb: http://www.iedr.ie\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin.\nRegistered in Ireland. No: 315315.\n ','(Registration Completed) Re: $D_Name','','','',NULL),(15,'DNSAcceptMod','                                                                                                                                                                                                     \r\nDear Registrant,\r\n                                                                                                                                                                                                     \r\nWe have verified the hosting information provided in your application.\r\n                                                                                                                                                                                                     \r\nYour modification has now been fully accepted for the domain : $D_Name.\r\n                                                                                                                                                                                                     \r\nThe changes to your domain will go live when the IE zone is next reloaded.\r\nThis occurs four times a day: 10am, 12pm, 5pm and 10pm, 7 days a week.\r\n                                                                                                                                                                                                     \r\nKind regards,\r\nIE Hostmaster\r\n                                                                                                                                                                                                     \r\ntel: +353-1-2365 400\r\nfax: +353-1-2300 365\r\nemail: hostmaster@iedr.ie\r\nweb: http://www.iedr.ie\r\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin. \r\nRegistered in Ireland. No: 315315. ','(Modification Completed) Re: $D_Name','','','',NULL),(16,'AdminFailReg','\r\n** This is Important ** Please read carefully **\r\n\r\nDear Registrant,\r\n\r\nThank you for your application for the domain name $D_Name\r\n\r\nMore than 20 days have elapsed since your application was submitted and we have not yet received\r\nall of the necessary requirements to complete the registration of this domain name.\r\n\r\nPlease submit any outstanding information that is required and we will proceed with your request.\r\nIf the requirements are not received within $diff days, your request will lapse and you \r\nwill need to resubmit your application.\r\n\r\nIf you have any queries in relation to your request please contact the Registration Services Department.\r\n\r\n\r\nKind regards,\r\nIE Hostmaster\r\n\r\ntel: +353-1-2365 400\r\nfax: +353-1-2300 365\r\nemail: hostmaster@iedr.ie\r\nweb: http://www.iedr.ie\r\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin. \r\nRegistered in Ireland. No: 315315. ','(Notice - Reg) Re: Continued hold up of $D_Name. $diff days remaining.','','','',NULL),(17,'AdminFailMod','\r\n** This is Important ** Please read carefully **\r\n\r\nDear Registrant,\r\n\r\nThank you for your modification request for the domain name $D_Name\r\n\r\nMore than 20 days have elapsed since your application was submitted and we have not yet received\r\nall of the necessary requirements to complete the registration of this domain name.\r\n\r\nPlease submit any outstanding information that is required and we will proceed with your request.\r\nIf the requirements are not received within $diff days, your request will lapse and you \r\nwill need to resubmit your application.\r\n\r\nIf you have any queries in relation to your request please contact the Registration Services Department.\r\n\r\n\r\nKind regards,\r\nIE Hostmaster\r\n\r\ntel: +353-1-2365 400\r\nfax: +353-1-2300 365\r\nemail: hostmaster@iedr.ie\r\nweb: http://www.iedr.ie\r\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin. \r\nRegistered in Ireland. No: 315315. ','(Notice - Mod) Continued hold up regarding $D_Name. $diff days remaining.','','','',NULL),(18,'acceptRegCond','D